function FontTest() {
	return (
		<div style={{
			backgroundColor: 'lightgray',
			padding: '1rem'
		}}>
			<h1 style={{ color: 'white' }}>Font Testing</h1>
			<p class='apple-text'>Apple Pixel</p>
			<h2 class='serpentine'>Serpentine</h2>
			<h2 class='serpentine-bold'>Serpentine Bold</h2>
			<h2 class='thunderstorm'>Thunderstorm</h2>
			<h2 class='apple-garamond'>Apple Garamond</h2>
			<h2 class='apple-garamond-light'>Apple Garamond Light</h2>
		</div>
	)
}

export default FontTest
